import React from "react";
import Carousel from "react-material-ui-carousel";
import { Paper, Button } from "@material-ui/core";
function MyCarousel(props) {
  var items = [
    {
      hinhAnh:
        "https://s3img.vcdn.vn/123phim/2021/04/lat-mat-48h-16177782153424.png",
      alt: "Img alt",
    },
    {
      hinhAnh:
        "https://s3img.vcdn.vn/123phim/2021/04/mortal-kombat-16177818818286.png",
      alt: "Img alt",
    },
    {
      hinhAnh:
        "https://s3img.vcdn.vn/123phim/2021/04/ban-tay-diet-quy-evil-expeller-16177781815781.png",
      alt: "Img alt",
    },
    {
      hinhAnh:
        "https://s3img.vcdn.vn/123phim/2021/04/nguoi-nhan-ban-seobok-16177781610725.png",
      alt: "Img alt",
    },
  ];

  return (
    <Carousel
      animation="slide"
      autoPlay={false}
      style={{
        height: "550px",
      }}
    >
      {items.map((item, i) => (
        <Item key={i} item={item} />
      ))}
    </Carousel>
  );
}

function Item(props) {
  return (
    <img
      src={props.item.hinhAnh}
      alt={props.item.alt}
      style={{
        display: "block",
        width: "100%",
        height: "auto",
        verticalAlign: "middle",
        border: "0",
      }}
    />
  );
}

export default MyCarousel;
